import React from 'react';

function MinutesInput() {
    const [time_values, goToPrev] = props;
    addHandler = (event) => {
        text = event.target.value
        time_values.minutes = text
        goToPrev()
    }
    return (
        <input 
            id = "minutes"
            // onInput = {}
            className = "time-input__input"
            placeholder="00"
            pattern="([0-5]?[0-9])$" required
        />
    )
}
export default MinutesInput
